// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity >=0.4.22 <0.9.0;
import "./libraries/SafeMath.sol";
import "./libraries/Ownable.sol";
import "./interfaces/IERC20.sol";

abstract contract ERC20 is Ownable, IERC20 {
    using SafeMath for uint256;

    mapping (address => uint256) internal _balances;
    mapping (address => mapping (address => uint256)) internal _allowances;

    uint256 internal _totalSupply;

    function getOwner() external view virtual override returns (address) { return owner();}
    function totalSupply() external virtual override view returns (uint256) {return _totalSupply;}
    function balanceOf(address owner) external virtual override view returns (uint256) {return _balances[owner];}
    function allowance(address owner, address spender) external virtual override view returns (uint256) {return _allowances[owner][spender];}
    function transfer(address to, uint256 value) external virtual override returns (bool) { _transfer(msg.sender, to, value);return true;}
    function approve(address spender, uint256 value) external virtual override returns (bool) {_approve(msg.sender, spender, value);return true;}
    function transferFrom(address from, address to, uint256 value) external virtual override returns (bool) {_transfer(from, to, value);_approve(from, msg.sender, _allowances[from][msg.sender].sub(value)); return true;}
    function increaseAllowance(address spender, uint256 addedValue) external virtual override returns (bool) {_approve(msg.sender, spender, _allowances[msg.sender][spender].add(addedValue));return true;}
    function decreaseAllowance(address spender, uint256 subtractedValue) external virtual override returns (bool) {_approve(msg.sender, spender, _allowances[msg.sender][spender].sub(subtractedValue));return true;}
    function _transfer(address from, address to, uint256 value) internal virtual {require(to != address(0));_balances[from] = _balances[from].sub(value);_balances[to] = _balances[to].add(value);emit Transfer(from, to, value);}
    function _mint(address account, uint256 value) internal virtual {require(account != address(0));_totalSupply = _totalSupply.add(value);_balances[account] = _balances[account].add(value);emit Transfer(address(0), account, value);}
    function _burn(address account, uint256 value) internal virtual {require(account != address(0));_totalSupply = _totalSupply.sub(value);_balances[account] = _balances[account].sub(value);emit Transfer(account, address(0), value);}
    function _approve(address owner, address spender, uint256 value) internal virtual {require(spender != address(0));require(owner != address(0));_allowances[owner][spender] = value;emit Approval(owner, spender, value);}
    function _burnFrom(address account, uint256 value) internal virtual {_burn(account, value);_approve(account, msg.sender, _allowances[account][msg.sender].sub(value));}
}
